/// This function gets glyph index in the array above
/// for given codepoint
static unsigned index_for_glyph (unsigned codepoint) {
  if (0x20 <= codepoint && codepoint <= 0x5b)
    return codepoint - 0x20 + 0;
  if (0x5d <= codepoint && codepoint <= 0x5f)
    return codepoint - 0x5d + 60;
  if (0x61 <= codepoint && codepoint <= 0x7d)
    return codepoint - 0x61 + 63;
  if (0xb1 <= codepoint && codepoint <= 0xb2)
    return codepoint - 0xb1 + 92;
  if (0x410 <= codepoint && codepoint <= 0x44f)
    return codepoint - 0x410 + 94;
  if (codepoint == 0x2116)
    return 158;
  if (codepoint == 0x21d2)
    return 159;
  if (codepoint == 0x2205)
    return 160;
  if (0xf00c <= codepoint && codepoint <= 0xf00d)
    return codepoint - 0xf00c + 161;
  if (codepoint == 0xf121)
    return 163;
  if (codepoint == 0xf185)
    return 164;
  if (codepoint == 0xf1f8)
    return 165;
  return 31;
}

